import { Navbar } from "./Navbar";
import { AllComponents } from "./ComponentContainer";
import { Board } from "./Board";
import { Route, Routes, Link } from "react-router-dom";
import { useGlobalContext } from "./context";
function App() {
  const { addBoard } = useGlobalContext();
  return (
    <main>
      <Navbar />

      <Link to="/boards">Home</Link>
      <form
        onSubmit={(e) => {
          e.preventDefault();
          addBoard(e.target.input.value);
          console.log("hv");
        }}
      >
        <label>Add a board:</label>
        <input type="text" name="input" />
        <Link to="/boards">
          <button type="submit">Add Coloumn</button>
        </Link>
      </form>
      <Routes>
        <Route path="/boards" element={<Board />} />
        <Route path="/lists" element={<AllComponents />} />
      </Routes>
    </main>
  );
}

export default App;
